import { HttpClientModule } from '@angular/common/http';
import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { WelcomePageComponent } from './componentes/welcome-page/welcome-page.component';
import { DirectoryDoctorComponent } from './componentes/doctor/directory-doctor.component';
import { DirectoryHospitalComponent } from './componentes/hospital/directory-hospital.component';
import { DirectorySpecialityComponent } from './componentes/speciality/directory-speciality.component';

@NgModule({
  declarations: [
    AppComponent,
    WelcomePageComponent,
    DirectoryDoctorComponent,
    DirectoryHospitalComponent,
    DirectorySpecialityComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
